try {
	//convert inbound message to Jsoup object.
	var Doc = Jsoup.parse(msg)

	if ($('debug') == '1') {
		logger.info('All a href thread values: ' + Doc.select('div.block-body').select('a[href*=/threads/]'))
	}
	//select all link in page starting with '/tread/', convert from object to string then turn into array based on ending '</a>' value
	var linkNav = Doc.select('div.block-body').select('a[href*=/threads/]').toString() + Doc.select('div.block-outer-main').select('a[href*=/forums/]').toString()
	var linkText = linkNav.split('</a>')
	if ($('debug') == '1') {
		logger.info('variable text : ' + linkText)
	}
	var pageText = new String(Doc.select('div.bbWrapper').text())
	logger.info('pageText: ' + pageText)

	//Iterate through text array
	for(link in linkText) {
		//convert each value in array back to html to strip out just the 'href' text value
		if ($('debug') == '1') {
			logger.info('link values: ' + Jsoup.parse(linkText[link]).select('a[href]').attr('href'))
		}
		//find all link within the webpage and filter out undesirables 
		var path = Jsoup.parse(linkText[link]).select('a[href]').attr('href')
		if (path.indexOf('#post-') == -1 && path.indexOf('/post-') == -1 && path.indexOf('/last') == -1 && path.indexOf('/latest') == -1 && path.indexOf('https://') == -1 && path.indexOf('/reader') == -1&& path.indexOf('/threadmarks') == -1) {
			insertURL(Jsoup.parse(linkText[link]).select('a[href]').attr('href'))
		}
	}
	if ($('debug') == '1') {
			logger.info('urlID: ' + $('urlID'))
		}
	//Call to have the url inserted into database 	
	if ($('urlID') != null && $('urlID') != undefined && $('urlID') != '') {
		processURL(1, null, $('urlID'))
		insertPost($('urlID'), pageText.replace(/[\n\r\t]/g, '').toString())
	}
//Catch any error and update database accordingly 	
}catch (e) {
	if ($('debug') == '1') {
		logger.info('Response processing error: ' + e)
	}
	if ($('urlID') != null || $('urlID') != undefined && $('urlID') != '') {
		processURL(0, e, $('urlID'))
	}
}

