		if (statement != null)
		{
			if (args != null && args.size() > 0)
			{
				statement.clearParameters();
				for (var i = 0; i < args.size(); i++)
				{
					//logger.info('args value: ' + args.get(i))
					statement.setObject(i + 1, args.get(i));
				}
			}
			row_count = statement.executeUpdate();
			statement.close();
		}
		else throw "updatePoolDbConn(): dbConn.prepareStatement() failed";
		dbConn.close();
	}
	else throw "updatePoolDbConn(): dbConn cannot connect to the database";
	return row_count;
}
